just a tip for all the ppl that think the download is slow, go to preferences ~ bandwidth ~ and change how many ppl u can connect to, 
if that doesnt work try not being a stingy bastard and set ur upload limit up to around 70 kb/s (minimum) and if that doeant work go to " setup guide" ~ run test, (this will test upload/download limit and adjust settings for you) 

